import { Component } from "react";
import  {
    Form, 
    Input, 
    Label, 
    FormGroup,
    Button
} from 'reactstrap'

function FormularioPublicar(){
    return (
        <Form>
            <FormGroup floating>
                <Input id='tema-post' placeholder="Tema del post:"/>
                <Label for='tema-post'>Tema del post:</Label>
            </FormGroup>
        </Form>
    )
}

export default FormularioPublicar
